        public static C1Icon GetControlIcon(string controlName, bool isNew, bool isFavorite)
        {
            PropertyInfo pi = typeof(ControlIcons).GetProperty(controlName, BindingFlags.Public | BindingFlags.Static);
            if (pi != null)
            {
                var icon = pi.GetValue(null, null) as C1Icon;
                if (icon != null)
                {
                    icon.Size = new Size(32, 32);
                    icon.Padding = new Thickness(4);

                    var cIcon = new C1CompositeIcon();
                    cIcon.Size = new Size(32, 32);
                    cIcon.Icons.Add(icon);

                    C1Icon badge = isNew ? New : (isFavorite ? Favorite : null);
                    if (badge != null)
                    {
                        cIcon.Icons.Add(badge);
                    }
                    return cIcon;

                }
            }
            return New;
        }
    }
